    between the disbursements and cash-on-hand totals disclosed on the summary pages
    of the original report and the amended report.  Previous filings disclosed estimates
    for independent expenditures, and while best efforts were made to accurately report
    the estimates, this report reflects the actual amounts spent for these activities.
    \      Also, 48-Hour Notices were previously filed to disclose salary and food
    estimates related to canvassing activities.  Therefore, the salaries and payments
    to Walgreens for food that are reported here as independent expenditures are not
    new independent expenditures, but rather represent a more detailed and accurate
    itemization of the following 48-Hour Notice that was previously filed:    10/18/12
    (Amended 12/4/12) - filed with individual canvassers as the vendors, and Florida
    New Majority as vendor for food     Finally, please note that we disclosed independent
    expenditures for canvasser salaries on 24 and 48-hour reports for the last few
    weeks of the month in total, but, in actuality the canvassers were paid on a weekly
    basis, which is accurately reflected in this report.  \n"
